<#
# Script Name: RFC-TriageCollect
# Author: RFC1918
# Last Modified: 2024-09-13
# Description: Collect forensics triage image using MAGNET Response
 
This script will:
 - Drop MAGNET Response to Temp directory
 - Collect System Information
 - Collect OS Information
 - Collect MAGNET Response Triage Image
 - Zip the collected files
 
Prerequirements:
 - [MAGNET Response](https://www.magnetforensics.com/resources/magnet-response/) (MagnetRESPONSE.exe) # File version 1.7.1.0
#>

# Parameters (Optional)
param (
    [ValidateSet("Default", "RAMCaptureOnly", "CriticalFilesOnly", "Custom")]
    [string]$CollectionMethod = "Default",
    [string]$CustomCollectionArguments = "",
    [string]$CaptureFiles = ".vbs,.ps1,.wsh"
)

# Helper Functions
function Print-Header {
    param (
        [string]$Title
    )
    $border = "-" * ($Title.Length + 4)
    Write-Host ""
    Write-Host "+$border+" -ForegroundColor Cyan
    Write-Host "|  $Title  |" -ForegroundColor Cyan
    Write-Host "+$border+" -ForegroundColor Cyan
    Write-Host ""
}

function Wait-ForFileRelease {
    param (
        [string]$FilePath,
        [int]$TimeoutSeconds = 10
    )
    $sw = [System.Diagnostics.Stopwatch]::StartNew()
    while ($sw.Elapsed.TotalSeconds -lt $TimeoutSeconds) {
        try {
            # Try to open the file in exclusive mode
            $fileStream = [System.IO.File]::Open($FilePath, 'Open', 'Read', 'None')
            $fileStream.Close()
            return $true
        } catch {
            # File is locked, wait and retry
            Start-Sleep -Seconds 1
        }
    }
    return $false
}

# Constants
$Timestamp = Get-Date -Format "yyyy-MM-dd_HH-mm-ss"
$MagnetRESPONSEChecksum = "341A42C9D95855CC62456EF30ECAD14F922E11CBC8374E83B4F758A6DBECC9DE" # File version 1.7.1.0
$CaseReference = "RFC-TriageCollect-$Timestamp"
$TempDirectory = "C:\Windows\debug\$CaseReference"
$LogFile = "$TempDirectory\$CaseReference.log"

Start-Transcript -Path $LogFile -Append

Write-Host ""
Write-Host "RFC-TriageCollect" -ForegroundColor Cyan
Write-Host "Author: RFC1918" -ForegroundColor Cyan
Write-Host "Version: 1.0" -ForegroundColor Cyan

# Prerequirements
# Check if we running as Administrator
if (-not ([Security.Principal.WindowsPrincipal][Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole([Security.Principal.WindowsBuiltInRole] "Administrator")) {
    Write-Warning "You need to run this script as an Administrator"
    exit
}

$ProgressPreference = "SilentlyContinue"

# Validate Temp Directory exist, else create one
if (-not (Test-Path $TempDirectory)) {
    New-Item -Path $TempDirectory -ItemType Directory | Out-Null
}

Print-Header "System Information"
# Get System Information
$SystemInfo = Get-WmiObject -Class Win32_ComputerSystem
Write-Host "Manufacturer:       $($SystemInfo.Manufacturer)"
Write-Host "Model:              $($SystemInfo.Model)"
Write-Host "Name:               $($SystemInfo.Name)"
Write-Host "Domain:             $($SystemInfo.Domain)"

Print-Header "OS Information"
# Get OS Information
$OSInfo = Get-WmiObject -Class Win32_OperatingSystem
Write-Host "OS Name:            $($OSInfo.Caption)"
Write-Host "OS Version:         $($OSInfo.Version)"
Write-Host "OS Architecture:    $($OSInfo.OSArchitecture)"

# Step 1: Drop MAGNET Response to Temp directory
Print-Header "Dropping MAGNET Response to Temp directory"

# Base64 encode MagnetRESPONSE.exe # File version 1.7.1.0
$MagnetRESPONSEBase64 = ""

# Decode MagnetRESPONSE.exe and drop to C:\Windows\System32\spool\drivers\color
$MagnetRESPONSE = [System.Convert]::FromBase64String($MagnetRESPONSEBase64)
$MagnetRESPONSEFilePath = "$TempDirectory\MagnetRESPONSE.exe"
[System.IO.File]::WriteAllBytes($MagnetRESPONSEFilePath, $MagnetRESPONSE)

Write-Host "MagnetRESPONSE.exe dropped to $TempDirectory"
Write-Host "`nValidating MagnetRESPONSE.exe checksum"
Write-Host " - Checksum $MagnetRESPONSEChecksum"
$DroppedMagnetRESPONSEChecksum = Get-FileHash -Path $MagnetRESPONSEFilePath -Algorithm SHA256 | Select-Object -ExpandProperty Hash
if ($MagnetRESPONSEChecksum -eq $DroppedMagnetRESPONSEChecksum) {
    Write-Host " - MagnetRESPONSE.exe checksum is valid"
} else {
    Write-Host " - MagnetRESPONSE.exe checksum is invalid"
    Write-Host "`nExiting script"
    Exit
}

# Step 2: Run MAGNET Response to collect triage image
Print-Header "Running MAGNET Response to collect triage image"

# Check input for arguments of what to collect
$MagnetRESPONSEArguments = @()
if ($CollectionMethod -eq "Default") {
    Write-Host "Default collection method selected"
    $MagnetRESPONSEArguments += "/captureram /capturevolatile /capturesystemfiles /captureextendedprocessinfo /capturefiles:$CaptureFiles /skipsystemfolders /maxsize:25000 /captureransomnotes"
    Write-Host " - Arguments: $MagnetRESPONSEArguments"
} elseif ($CollectionMethod -eq "RAMCaptureOnly") {
    Write-Host "RAMCaptureOnly collection method selected"
    $MagnetRESPONSEArguments += "/captureram /capturevolatile"
    Write-Host " - Arguments: $MagnetRESPONSEArguments"
} elseif ($CollectionMethod -eq "CriticalFilesOnly") {
    Write-Host "CriticalFilesOnly collection method selected"
    $MagnetRESPONSEArguments += "/capturesystemfiles"
    Write-Host " - Arguments: $MagnetRESPONSEArguments"
} elseif ($CollectionMethod -eq "Custom") {
    Write-Host "Custom collection method selected"
    $MagnetRESPONSEArguments += $CustomCollectionArguments
    Write-Host " - Arguments: $MagnetRESPONSEArguments"
} else {
    Write-Host "Invalid CollectionMethod specified"
    Write-Host "`nExiting script"
    Exit
}

& "$MagnetRESPONSEFilePath" -c "/accepteula /unattended /silent /caseref:$CaseReference /output:`"$TempDirectory`" $MagnetRESPONSEArguments"
Wait-Process -Name "MagnetRESPONSE"
Write-Host "`nMAGNET Response triage image collected"
Start-Sleep 15

# Step 3: Archive triage image to zip
Print-Header "Archiving triage image to zip"

$TriageDirectoryPath = Get-ChildItem -Path "$TempDirectory\$CaseReference*" -Directory | Select-Object -ExpandProperty FullName
$TriageDirectoryName = Split-Path -Leaf $TriageDirectoryPath
$TriageImageZipPath = "$TempDirectory\$TriageDirectoryName.zip"

Write-Host "Arhiving Folder:            $TriageDirectoryPath"
Write-Host "Zip File:                   $TriageImageZipPath"

Add-Type -AssemblyName "System.IO.Compression.FileSystem"
[System.IO.Compression.ZipFile]::CreateFromDirectory($TriageDirectoryPath, $TriageImageZipPath)

# Confirm zip file was created
if (Test-Path $TriageImageZipPath) {
    Write-Host "`nTriage image archived to $TriageImageZipPath"
    # Get checksum of triage image
    $TriageImageChecksum = Get-FileHash -Path $TriageImageZipPath -Algorithm SHA256 | Select-Object -ExpandProperty Hash
    Write-Host " - Checksum $TriageImageChecksum"
} else {
    Write-Host "`nFailed to archive triage image to zip"
    Write-Host "`nExiting script"
    Exit
}

# Step 4: Exit script
Write-Host ""
Stop-Transcript